import './App.css';
import { BrowserRouter as Router,Routes, Route } from 'react-router-dom';
import Join from "./component/Join/join";
import join from './component/Join/join';



function App() {



  return (
    <div className="App">
      <Routes>

        <Route path="/" element={Join} />
        <Route path="/chat" element={join} />

      </Routes>



    </div>
  );
}

export default App;
